import React, { Component } from 'react'

export default class app extends Component {

  constructor() {
    super()
    this.state = {
      board: [
        [0, 0, 0],
        [0, 0, 0],
        [0, 0, 0]
      ]
    }
  }

  render() {
    const { board } = this.state;
    console.log(board)
    return (
    <>
      {board.map((item,index) =>
      item.map((m, i) => 
        <div>i</div>
      )
      )}
    </>
    )
  }
}
